import React from 'react';

const Internships = () => {
  const internships = [
    {
      title: 'Full Stack Developer Intern',
      company: 'Tech Solutions Inc.',
      duration: 'June 2023 - August 2023',
      location: 'Remote',
      description: 'Developed and maintained web applications using React.js and Node.js. Collaborated with senior developers to implement new features and fix bugs.',
      achievements: [
        'Built a responsive dashboard that improved user engagement by 40%',
        'Implemented RESTful APIs that reduced data loading time by 50%',
        'Participated in daily standups and code review sessions'
      ],
      technologies: ['React.js', 'Node.js', 'MongoDB', 'Express.js', 'Git']
    },
    {
      title: 'Frontend Developer Intern',
      company: 'Digital Agency Co.',
      duration: 'January 2023 - March 2023',
      location: 'New York, NY',
      description: 'Focused on creating pixel-perfect UI components and improving user experience across multiple client projects.',
      achievements: [
        'Designed and developed 15+ reusable React components',
        'Improved website performance scores by 30%',
        'Worked directly with UX designers to implement design systems'
      ],
      technologies: ['React.js', 'TypeScript', 'Tailwind CSS', 'Figma', 'Jest']
    },
    {
      title: 'Software Development Intern',
      company: 'StartupXYZ',
      duration: 'September 2022 - December 2022',
      location: 'San Francisco, CA',
      description: 'Contributed to the development of a mobile-first web application and gained experience in agile development practices.',
      achievements: [
        'Developed mobile-responsive features for 10,000+ users',
        'Integrated third-party APIs and payment processing',
        'Participated in sprint planning and retrospective meetings'
      ],
      technologies: ['JavaScript', 'Python', 'Django', 'PostgreSQL', 'Docker']
    }
  ];

  return (
    <section id="internships" className="py-16 sm:py-20 lg:py-24 bg-white">
      <div className="container-max section-padding">
        <div className="max-w-6xl mx-auto">
          {/* Section Header */}
          <div className="text-center mb-16">
            <h2 className="text-3xl sm:text-4xl lg:text-5xl font-bold text-nature-white-900 mb-6">
              My <span className="text-gradient">Internships</span>
            </h2>
            <p className="text-lg text-nature-white-600 max-w-3xl mx-auto">
              Professional experiences that shaped my development journey
            </p>
            <div className="w-24 h-1 bg-gradient-to-r from-nature-green-400 to-nature-green-600 mx-auto rounded-full mt-6"></div>
          </div>

          {/* Timeline */}
          <div className="relative">
            {/* Timeline line */}
            <div className="absolute left-4 md:left-1/2 transform md:-translate-x-1/2 w-0.5 h-full bg-gradient-to-b from-nature-green-400 to-nature-green-600"></div>

            {/* Internship Cards */}
            <div className="space-y-12">
              {internships.map((internship, index) => (
                <div key={index} className={`relative flex items-center ${index % 2 === 0 ? 'md:flex-row' : 'md:flex-row-reverse'}`}>
                  {/* Timeline dot */}
                  <div className="absolute left-4 md:left-1/2 transform md:-translate-x-1/2 w-4 h-4 bg-nature-green-500 rounded-full border-4 border-white shadow-lg z-10"></div>
                  
                  {/* Content */}
                  <div className={`ml-12 md:ml-0 w-full ${index % 2 === 0 ? 'md:pr-8 md:mr-1/2' : 'md:pl-8 md:ml-1/2'}`}>
                    <div className="card hover:shadow-2xl transition-all duration-300">
                      {/* Header */}
                      <div className="flex flex-col sm:flex-row sm:items-center sm:justify-between mb-4">
                        <div>
                          <h3 className="text-xl font-bold text-nature-white-900 mb-1">
                            {internship.title}
                          </h3>
                          <p className="text-lg font-semibold text-nature-green-600 mb-2">
                            {internship.company}
                          </p>
                        </div>
                        <div className="text-sm text-nature-white-500 mb-2 sm:mb-0">
                          <div className="font-medium">{internship.duration}</div>
                          <div>{internship.location}</div>
                        </div>
                      </div>

                      {/* Description */}
                      <p className="text-nature-white-600 mb-6 leading-relaxed">
                        {internship.description}
                      </p>

                      {/* Achievements */}
                      <div className="mb-6">
                        <h4 className="font-semibold text-nature-white-900 mb-3">Key Achievements:</h4>
                        <ul className="space-y-2">
                          {internship.achievements.map((achievement, achievementIndex) => (
                            <li key={achievementIndex} className="flex items-start">
                              <span className="text-nature-green-500 mr-2 mt-1">✓</span>
                              <span className="text-nature-white-600">{achievement}</span>
                            </li>
                          ))}
                        </ul>
                      </div>

                      {/* Technologies */}
                      <div>
                        <h4 className="font-semibold text-nature-white-900 mb-3">Technologies Used:</h4>
                        <div className="flex flex-wrap gap-2">
                          {internship.technologies.map((tech, techIndex) => (
                            <span key={techIndex} className="px-3 py-1 bg-nature-green-100 text-nature-green-700 rounded-full text-sm font-medium">
                              {tech}
                            </span>
                          ))}
                        </div>
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Internships;
